import React, { Component } from 'react'
import { Switch, Route, Redirect, Link } from 'react-router-dom';
import { MDBBtn, MDBCollapse } from 'mdbreact';
import { Card, CardTitle }
from 'reactstrap';
import {BrowserRouter, withRouter} from 'react-router-dom';
import { Contacts } from './ContactComponent';
import { Home } from './HomeComponent';
import { Tools } from './ToolsComponent'
import { TransitionGroup, CSSTransition }from 'react-transition-group';
import { Test } from './TestComponent';
import { CardImg, CardText, CardBody,  CardSubtitle } from 'reactstrap';
import Typist from 'react-typist';

class Main extends Component {
  state = {
      collapseID: "",
    };

  toggleCollapse = collapseID => () => {
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ""
    }));
  }

  render() {

  return (

    <React.Fragment className="header col-12 col-md-10 ">
        <Test />
      <MDBBtn
        className="col-5 col-sm-7 col-md-12 m-1 btn btn-dark btn-circle btn-xl"
        onClick={this.toggleCollapse("basicCollapse")}>
        <i class="d-none d-md-block fa fa-cog fa-spin fa-3x fa-fw"></i>    
      </MDBBtn>
      <MDBCollapse id="basicCollapse" isOpen={this.state.collapseID}>

      <div className="container">
        <div className="row ">
          <Card id="card"  >
            <CardTitle id="cardtitle" className='row justify-content-center'>
              <Link className="links" to="/home"><span>home</span></Link>      
              <Link className="links" to="/tools"><span>tools</span></Link>
              <Link className="links" to="/contacts"><span>contacts</span></Link>
            </CardTitle>

      <CardBody>
        <CardSubtitle >
            <Typist className="textCard">
              Hello, My Name is Hossik<CardImg top id="cardimage"  width="100%" src="../assets/hossik.jpeg" alt="hossik" />.
            </Typist>
        </CardSubtitle>
        <CardText className="textCard" >

          <Typist  
          className="textCard"
          stdTypingDelay="100" 
          startDelay="2500"
          cursor={{
            show: true,
            blink: true,
            element: this.state.blinking,
            hideWhenDone: true,
            hideWhenDoneDelay: '1000',
          }}
          onCharacterTyped={this.blink}
          onLineTyped={this.blinkFinish}
          onTypingDone={this.blinkFinish}
          >
          Typist will animate any text present in its descendents. Each text node will be animated<Typist.Delay ms={2500} /><Typist.Backspace count={8} delay={200} /><br/><Typist.Delay ms={2500} />as it is encountered in depth-first traversal of the children tree, one after the other.
          </Typist>

        </CardText>
      </CardBody>


          </Card>
        </div>
      </div>

      </MDBCollapse>
    </React.Fragment>
    )
  }
}

export default withRouter(Main);
